import React from 'react';
import CartHeader from '../components/CartHeader';

const Cart = () => {
  return (
    <div>
      <CartHeader/>
      <div>
        <div>
            <div className='w-[5%]' >

            </div>
            <div className='w-[10%]' >

            </div>
            <div>
                <h1>Product</h1>
            </div>
            <div>
                <h1>Price</h1>
            </div>
            <div>
                <h1>Quantity</h1>
            </div>
            <div>
                <h1>Subtotal</h1>
            </div>
        </div>
      </div>
    </div>
  );
};

export default Cart;
